import React from 'react'
import { Link } from 'react-router-dom';
import Logo from '../images/safaricom-connect-logo.png'

import { Button } from "@material-ui/core";
import { Person } from "@material-ui/icons";

function Navbar() {
    return (

        <header className="mainheader pt-5 pl-5">

            <Button 
            variant="contained" 
            color="primary"  
            size="large" 
            startIcon={< Person />}
            style={{background:"#000", color:"#FFF"}}>
                Send Message
            </Button>

        </header>        

    )
}

export default Navbar
